import React from 'react';
import CardItem from './CardItem';
import './Cards.css';

function Cards() {
    return (
        <div className='cards'>
            <h1>Rail Transport System</h1>
            <div className="cards__container">
                <div className="cards_wrapper">
                    <ul className="cards__items">
                        <CardItem />
                        src="im"
                    </ul>
                </div>
            </div>
        </div>
    )
}


export default Cards
